import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Mevcut ve çalışan sayfalarınız
import LoginPage from './LoginPage';
import Dashboard from './Dashboard';
import ForgotPasswordPage from './ForgotPasswordPage';
import VehiclesPage from './VehiclesPage';
import CreditCalculatorPage from './CreditCalculatorPage';

// YENİ OLUŞTURDUĞUMUZ VE ARTIK HAZIR OLAN SAYFA
import PersonnelPage from './PersonnelPage'; 

// Henüz hazır olmayan modüller yorumda kalabilir
// import PiyasaPage from './PiyasaPage';

function App() {
  return (
    <Router>
      <Routes>
        {/* Mevcut rotalarınız */}
        <Route path="/" element={<LoginPage />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/forgot-password" element={<ForgotPasswordPage />} />
        <Route path="/vehicles" element={<VehiclesPage />} />
        <Route path="/kredi-hesaplama" element={<CreditCalculatorPage />} /> {/* URL'i daha anlaşılır hale getirdim, isterseniz "/kredi" olarak bırakabilirsiniz */}

        {/* ====================================================== */}
        {/* ===== YENİ EKLENEN PERSONEL SAYFASI ROTASI ===== */}
        {/* ====================================================== */}
        <Route path="/personnel" element={<PersonnelPage />} />

        {/* Henüz hazır olmayan diğer modüller */}
        {/* <Route path="/piyasa" element={<PiyasaPage />} /> */}
      </Routes>
    </Router>
  );
}

export default App;
